import React, { Component } from 'react';
import Link from 'next/link';

class Homepage extends Component {
    render() {
        return (
            <div className="wrapper">
                <div className="title">Hello, I am <span className="text-blue-light">F</span>ran JurmanoviÄ‡</div>
                <div className="nav">You can learn more <Link href="/about">about me</Link> or jump right to my <Link href="/portfolio"><span className="btn btn-blue f1 p-6">portfolio</span></Link></div>
            </div>
        );
    }
}

export default Homepage;
